_source.message:
New York City Mayor Eric Adams held a State of the City speech today, highlighting his familiar priorities of crime, jobs, housing, and rats. The speech, held at the Queens Theatre in Flushing Meadows Corona Park, was attended by top government officials, lobbyists, advocates, and activists and provided an opportunity for the mayor to set an agenda for the new year and reflect on the accomplishments of his administration in its first year.

Mayor Eric Adams also announced that NYC will work with Albany to push a new bill to increase penalties for aggressive and law-breaking drivers. He referred to the legislation as ROADS – “Removing Offenders and Aggressive Drivers from our Streets”. He highlighted this as an urgent issue as the city closed out another violent year, with 255 people killed by drivers in 2022.
